import React from 'react'

const BASE_URL = 'https://sandpit-api.safetyculture.io';
function generateToken(username, password, apiURL = BASE_URL) {
    return rp({
        method: 'POST',
        uri: apiUrl + '/auth',
        form: {
          username,
          password,
          grant_type: 'password'
        },
        json: true
      })
      .then(body => body.access_token)
      .catch(() => { throw new Error('Invalid username or password'); });
}

const App = () => {
    return(
        <div>Hello World</div>
    )
}

export default App
